block('card-movie').elem('cover')(

  match( node => !node._cover ).def()(''),

  def()( ( node ) => {
    return applyNext( {
      _cover: node._cover
        ? '//dev.artdoc.media' + node._cover.path
        : 'data:image/png;base64,'
    } );
  }),

  content()( ( node, ctx ) => {
    return [
      {
        block: 'image',
        // mix: { block: node.block, elem: node.elem },
        mods: {
          cover: 'width'
        },
        url: node._cover
      },
      ctx.cover && {
        elem: 'on-cover',
        content: ctx.cover
      }
    ]
  })
);
